  true,\n\t\"url\": null,\n\t\"notes\": \"The NIST/ARPA-E Database of Novel and Emerging
  Adsorbent Materials is a free, web-based catalog of adsorbent materials and measured
  adsorption properties of numerous materials obtained from article entries from the
  scientific literature. Search fields for the database include adsorbent material,
  adsorbate gas, experimental conditions (pressure, temperature), and bibliographic
  information (author, title, journal), and results from queries are provided as a
  list of articles matching the search parameters. The database also contains adsorption
  isotherms digitized from the cataloged articles, which can be compared visually
  online in the web application or exported for offline analysis.\",\n\t\"license_title\":
